"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[5613],{88321:(e,t,i)=>{i.r(t),i.d(t,{default:()=>r,johnChapter9PL:()=>o});const o={chapter:9,title:"Jean 9",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"A Jezus id\u0105c, ujrza\u0142 cz\u0142owieka \u015blepego od urodzenia.",strong:[{text:"homme",strong:"G444",start:26,end:31},{text:"naissance",strong:"G36",start:43,end:52}]},{number:2,text:"I pytali go uczniowie jego, m\xf3wi\u0105c: Mistrzu! kto zgrzeszy\u0142, ten, czyli rodzice jego, \u017ce si\u0119 \u015blepym urodzi\u0142?",strong:[{text:"cette",strong:"G3778",start:25,end:30},{text:"homme",strong:"G444",start:65,end:70}]},{number:3,text:"Odpowiedzia\u0142 Jezus: Ani ten zgrzeszy\u0142, ani rodzice jego, ale aby by\u0142y objawione sprawy Bo\u017ce na nim.",strong:[{text:"Dieu",strong:"G2316",start:99,end:103}]},{number:4,text:"Ja musz\u0119 sprawowa\u0107 sprawy tego, kt\xf3ry mi\u0119 pos\u0142a\u0142, pok\u0105d dzie\u0144 jest; przyjdzie noc, kt\xf3rej nikt nie b\u0119dzie m\xf3g\u0142 dzia\u0142a\u0107.",strong:[{text:"jour",strong:"H3117",start:39,end:43},{text:"nuit",strong:"G3571",start:84,end:88},{text:"personne",strong:"G3762",start:99,end:107}]},{number:5,text:"P\xf3kim jest na \u015bwiecie, \u015bwiat\u0142o\u015bci\u0105 \u015bwiata jestem.",strong:[{text:"dans",strong:"H6887",start:20,end:24},{text:"monde",strong:"G2889",start:28,end:33},{text:"monde",strong:"G2889",start:57,end:62}]},{number:6,text:"To powiedziawszy, plun\u0105\u0142 na ziemi\u0119, i uczyni\u0142 b\u0142oto ze \u015bliny, i pomaza\u0142 b\u0142otem oczy \u015blepego,",strong:[{text:"avoir",strong:"G1372",start:6,end:11},{text:"terre",strong:"H776",start:34,end:39},{text:"avec",strong:"G1848",start:59,end:63},{text:"cette",strong:"G3778",start:92,end:97}]},{number:7,text:"I rzek\u0142 mu: Id\u017a, umyj si\u0119 w sadzawce Siloam, (kt\xf3re si\u0119 wyk\u0142ada: Pos\u0142any.) Poszed\u0142 tedy, i umy\u0142 si\u0119, i przyszed\u0142 widz\u0105c.",strong:[]},{number:8,text:"A s\u0105siedzi i ci, kt\xf3rzy go przedtem widzieli, \u017ce by\u0142 \u015blepym, m\xf3wili: Aza\u017c to nie jest ten, kt\xf3ry siedzia\u0142 i \u017cebra\u0142?",strong:[{text:"comme",strong:"G2531",start:51,end:56}]},{number:9,text:"Niekt\xf3rzy m\xf3wili: Ten jest; a insi m\xf3wili: Podobien jest do niego. Ale on rzek\u0142: Jam jest.",strong:[]},{number:10,text:"Tedy mu m\xf3wili: Jako\u017c s\u0105 otworzone oczy twoje?",strong:[]},{number:11,text:"Odpowiedzia\u0142 on i rzek\u0142: Cz\u0142owiek, kt\xf3remu imi\u0119 Jezus, uczyni\u0142 b\u0142oto, i pomaza\u0142 oczy moje, i rzek\u0142 mi: Id\u017a do sadzawki Siloam, a umyj si\u0119. A gdym poszed\u0142 i umy\u0142 si\u0119, przejrza\u0142em.",strong:[{text:"homme",strong:"G444",start:15,end:20},{text:"oint",strong:"G5547",start:62,end:66}]},{number:12,text:"I rzekli mu: Gdzie\u017c on jest? Rzek\u0142: Nie wiem.",strong:[{text:"homme",strong:"G444",start:27,end:32}]},{number:13,text:"I przywiedli do Faryzeusz\xf3w onego, kt\xf3ry przedtem by\u0142 \u015blepym.",strong:[]},{number:14,text:"A by\u0142 sabat, gdy Jezus uczyni\u0142 b\u0142oto, i otworzy\u0142 oczy jego.",strong:[{text:"jour",strong:"H3117",start:15,end:19}]},{number:15,text:"Tedy go zasi\u0119 pytali i Faryzeuszowie, jako przejrza\u0142. I rzek\u0142 im: B\u0142oto po\u0142o\u017cy\u0142 mi na oczy, i umy\u0142em si\u0119, a widz\u0119.",strong:[{text:"nouveau",strong:"G2537",start:3,end:10}]},{number:16,text:"Tedy niekt\xf3rzy z Faryzeusz\xf3w m\xf3wili: Ten cz\u0142owiek nie jest z Boga, bo sabatu nie strze\u017ce. Inni m\xf3wili: Jako\u017c mo\u017ce cz\u0142owiek grzeszny takowe znaki czyni\u0107? I by\u0142 roz\u0142am mi\u0119dzy nimi.",strong:[{text:"homme",strong:"G444",start:49,end:54},{text:"Dieu",strong:"G2316",start:71,end:75},{text:"homme",strong:"G444",start:137,end:142},{text:"faire",strong:"G1080",start:159,end:164}]},{number:17,text:"Rzekli zasi\u0119 \u015blepemu: Co ty powiadasz o nim, \u017ce ci otworzy\u0142 oczy? A on rzek\u0142: \u017be prorok jest.",strong:[]},{number:18,text:"Ale nie wierzyli \u017bydowie o nim, \u017ce by\u0142 \u015blepym, i przejrza\u0142, a\u017c przyzwali rodzic\xf3w onego, kt\xf3ry by\u0142 przejrza\u0142.",strong:[]},{number:19,text:"I pytali ich, m\xf3wi\u0105c: Ten li jest syn wasz, o kt\xf3rym wy powiadacie, \u017ce si\u0119 \u015blepym urodzi\u0142? jako\u017c tedy teraz widzi?",strong:[{text:"fils",strong:"G5207",start:50,end:54}]},{number:20,text:"Odpowiedzieli im rodzice jego i rzekli: Wiemy, i\u017c ten jest syn nasz, i \u017ce si\u0119 \u015blepym urodzi\u0142;",strong:[{text:"fils",strong:"G5207",start:53,end:57}]},{number:21,text:"Ale jako teraz widzi, nie wiemy, albo kto mu otworzy\u0142 oczy, nie wiemy; on sam ma lata swoje, jego pytajcie, sam o sobie przem\xf3wi.",strong:[]},{number:22,text:"To m\xf3wili rodzice jego, \u017ce si\u0119 bali \u017byd\xf3w; bo ju\u017c byli postanowili \u017bydowie, aby, je\u017aliby go kto wyzna\u0142 by\u0107 Chrystusem, by\u0142 wy\u0142\u0105czony z b\xf3\u017cnice.",strong:[{text:"Christ",strong:"G5547",start:142,end:148}]},{number:23,text:"Przeto\u017c rodzice jego rzekli: Ma lata swoje, jego pytajcie.",strong:[]},{number:24,text:"Tedy zawo\u0142ali po wt\xf3re cz\u0142owieka onego, kt\xf3ry by\u0142 \u015blepym, i rzekli mu: Daj chwa\u0142\u0119 Bogu; wiemy, \u017ce ten cz\u0142owiek grzesznik jest.",strong:[{text:"homme",strong:"G444",start:45,end:50},{text:"Dieu",strong:"G2316",start:108,end:112},{text:"homme",strong:"G444",start:134,end:139}]},{number:25,text:"Tedy on odpowiedzia\u0142 i rzek\u0142: Je\u017ali jest grzesznik, nie wiem; jednom wiem, \u017ce gdym by\u0142 \u015blepym, teraz widz\u0119.",strong:[]},{number:26,text:"I rzekli mu zasi\u0119: C\xf3\u017c ci uczyni\u0142? jako\u017c ci otworzy\u0142 oczy?",strong:[]},{number:27,text:"Odpowiedzia\u0142 im: Powiedzia\u0142em wam ju\u017c, a nie s\u0142yszeli\u015bcie; przecz\u017ce zasi\u0119 chcecie s\u0142ysze\u0107? Aza\u017c i wy chcecie by\u0107 uczniami jego?",strong:[{text:"devenir",strong:"G1096",start:126,end:133}]},{number:28,text:"Tedy go z\u0142orzeczyli, i rzekli: Ty jeste\u015b uczniem jego, a my jeste\u015bmy uczniowie Moj\u017ceszowi.",strong:[{text:"disciple",strong:"G3101",start:50,end:58}]},{number:29,text:"My wiemy, \u017ce Moj\u017ceszowi m\xf3wi\u0142 B\xf3g; ale tego nie wiemy, sk\u0105d jest.",strong:[{text:"Dieu",strong:"G2316",start:16,end:20}]},{number:30,text:"Odpowiedzia\u0142 on cz\u0142owiek i rzek\u0142 im: To\u0107 to jest dziwna rzecz, \u017ce wy nie wiecie, sk\u0105d jest, a on mi otworzy\u0142 oczy.",strong:[{text:"homme",strong:"G444",start:4,end:9}]},{number:31,text:"A wiemy, i\u017c B\xf3g grzesznik\xf3w nie s\u0142ucha; ale je\u017aliby kto by\u0142 bogobojny i wol\u0119 jego czyni\u0142, tego s\u0142ucha.",strong:[{text:"Dieu",strong:"G2316",start:16,end:20}]},{number:32,text:"Od wiek\xf3w nie s\u0142yszano, aby kto otworzy\u0142 oczy \u015blepego od urodzenia.",strong:[{text:"dire",strong:"H559",start:22,end:26}]},{number:33,text:"By ten nie by\u0142 z Boga, nie m\xf3g\u0142by nic uczyni\u0107.",strong:[{text:"homme",strong:"G444",start:7,end:12},{text:"Dieu",strong:"G2316",start:30,end:34},{text:"rien",strong:"G3762",start:51,end:55},{text:"faire",strong:"G1080",start:56,end:61}]},{number:34,text:"Odpowiedzieli i rzekli mu: Ty we wszytkich grzechach jeste\u015b narodzon, a ty nas uczysz? I wyrzucili go precz.",strong:[{text:"tout",strong:"G3956",start:30,end:34},{text:"dans",strong:"H6887",start:42,end:46}]},{number:35,text:"Us\u0142ysza\u0142 Jezus, \u017ce go precz wyrzucili, a znalaz\u0142szy go, rzek\u0142 mu: Ty wierzysz\u017ce w Syna Bo\u017cego?",strong:[{text:"Fils",strong:"G5207",start:85,end:89},{text:"Dieu",strong:"G2316",start:93,end:97}]},{number:36,text:"On odpowiedzia\u0142 i rzek\u0142: A kt\xf3ry\u017c jest, Panie! abym we\u0144 uwierzy\u0142?",strong:[{text:"Seigneur",strong:"G2962",start:28,end:36}]},{number:37,text:"I rzek\u0142 mu Jezus: I widzia\u0142e\u015b go, a ten, kt\xf3ry m\xf3wi z tob\u0105, ten jest.",strong:[]},{number:38,text:"A on rzek\u0142: Wierz\u0119, Panie! i pok\u0142oni\u0142 mu si\u0119.",strong:[{text:"Seigneur",strong:"G2962",start:21,end:29}]},{number:39,text:"I rzek\u0142 Jezus: Ja na s\u0105d przyszed\u0142em na ten \u015bwiat, aby ci, kt\xf3rzy nie widz\u0105, widzieli, a kt\xf3rzy widz\u0105, aby si\u0119 \u015blepymi stali.",strong:[{text:"dans",strong:"H6887",start:29,end:33},{text:"monde",strong:"G2889",start:37,end:42},{text:"jugement",strong:"G2920",start:51,end:59}]},{number:40,text:"I us\u0142yszeli to niekt\xf3rzy z Faryzeusz\xf3w, kt\xf3rzy z nim byli, i rzekli mu: Aza\u017c i my \u015blepi jeste\u015bmy?",strong:[{text:"avec",strong:"G1848",start:32,end:36}]},{number:41,text:"Rzek\u0142 im Jezus: By\u015bcie byli \u015blepi, nie mieliby\u015bcie grzechu; ale teraz powiadacie: Widzimy; przeto\u017c grzech wasz zostaje.",strong:[]}]},r=o}}]);
